import "./styles.css";

import { Carousel, CardInfo } from "../../components/ui/CardsComponents/index";

import CustomLink from "../../components/ui/customLink/customLink.jsx";

const CardPage = () => {
  return (
    <div className="card-page">
      <div className="line-back">
        <CustomLink>
          <p>&larr;</p>
          <p>Back</p>
        </CustomLink>
      </div>
      <div className="sneaker-content">
        <Carousel />
        <CardInfo />
      </div>
    </div>
  );
};

export default CardPage;
